package com.java.basicsProgram;

public class Cal_SquareRoot {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println(calSquareRoot(300));

	}

	
	public static double calSquareRoot(double j) {
		
		
	double i = Math.sqrt(j);
		
		
		return i;
		
		
		
	}
}
